import React, { Component } from 'react'
import "./sass/main.scss"
import "./App.css";
import HomePage from './Screen/HomePage';
import CoursesPage from './Screen/CoursePage';
import LoginPage from "./Screen/LoginPage";
import CourseDetailPage from './Screen/CourseDetailPage'
import CartPage from "./Screen/CartPage"
import CheckoutPage from "./Screen/CheckoutPage"
import SignUpPage from "./Screen/SignUpPage";
import UserPage from "./Screen/UserPage";
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Header from './Component/Header/Header';


export default class App extends Component {
  render() {
    return (
      <div className="App">
       <HomePage/>
        {/* <SignUpPage/> */}
        {/* <LoginPage /> */}
        {/* <CourseDetailPage/> */}
        {/* <CoursesPage/>  */}

        {/* <CartPage/> */}
        {/* <CheckoutPage/> */}
        {/* <UserPage /> */}
        {/* <AdminPage/> */}

        <BrowserRouter>
       
            <Switch>
              <Route exact path="/home" component={HomePage} />
              <Route exact path="/CourseDetailPage" component={CourseDetailPage} />
              <Route exact path="/CartPage" component={CartPage} />

              <Route exact path="/CheckoutPage" component={CheckoutPage} />
            </Switch>
        </BrowserRouter>
      </div>
    )
  }
}
